css:
.github-StubItem-git-tab-controller {
  flex: 1;
  display: flex;
}
.github-PanelEtchWrapper {
  flex: 1;
  display: flex;
  min-width: 0;
}
.github-Panel {
  flex: 1;
  display: flex;
  flex-direction: column;
  min-width: 0;
  font-family: 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  font-size: 11px;
  color: rgba(248, 248, 242, 0.6);
  -webkit-user-select: none;
  cursor: default;
}
.github-Panel.no-repository {
  padding: 6px;
  text-align: center;
}
.github-Panel.is-loading {
  color: rgba(248, 248, 242, 0.2);
}
.github-Panel.no-repository {
  display: flex;
  justify-content: center;
  font-size: 1.25em;
}
.github-Panel.no-repository > * {
  margin: 2px 0;
}
.github-Panel.no-repository .git-logo-path {
  fill: rgba(72, 74, 75, 0.864);
}
.github-Panel.no-repository .btn.btn-primary {
  overflow: hidden;
  text-overflow: ellipsis;
}
atom-dock.bottom .github-Panel {
  flex-direction: row;
}
atom-dock.bottom .github-StagingView {
  flex-direction: row;
  flex: 2;
}
atom-dock.bottom .github-StagedChanges {
  border-left: 1px solid rgba(0, 0, 0, 0.5);
  border-right: 1px solid rgba(0, 0, 0, 0.5);
}
atom-dock.bottom .github-StagingView-group:first-child .github-StagingView-header {
  border-top: 1px solid rgba(0, 0, 0, 0.5);
}
atom-dock.bottom .github-CommitView {
  flex: 1;
}
